import house from "./imgs/househelp1.png";
import logo from "./imgs/logo.png"

function Header() {


    return (
      <div className="Header" style={{width:"100%"}}>
            <div id="header" style={{width: "100%", height:"auto", textAlign: "center", backgroundColor: "lightgreen", borderBottom:"2px solid green"}}> 
                <img src={logo} style={{width: "60%" , maxHeight: "auto", marginLeft: "auto", marginRight: "auto"}}></img>
            </div>

            <div style={{width: "150px", height: "auto", marginLeft: "auto", marginRight: "auto",}}>
                   <img src={house} width="100%" height="auto" ></img>
            </div>

     </div>
    );
  }

  export default Header;
